import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f1e7afee.js";const o={},c=t("<p>《三命通会》卷 九·六己日甲戌时断</p><p>六己日生时甲戌，妻从夫化为真土；</p><p>如通月气禄源深，反此而言平常取。</p><p>己日甲戌时，妻从夫化。</p><p>己合甲木化土成局，土神钟秀、禄源深厚。</p><p>月中无化，取甲为官，丙为印，戌土上甲木成形，丙火合局。</p><p>通月气，贵；不通，有刑冲破害者平常，己身虽吉，父母早失。</p><p>己丑日甲戌时，克父太旺。</p><p>辰月生，土厚。</p><p>居巳午末申，临官、帝旺，吉。</p><p>亥戌寅卯，土病死，凶。</p><p>酉辰，三、四品，贵，中年退闲。</p><p>亥木火运，六、七品，贵。</p><p>己卯日甲戌时，丙丁午戌年月，干有庚辛制伏官煞，生山明水秀地方，官至二、三品。</p><p>未酉丑月，行土火运，四、五品。</p><p>午月、东北运，大贵。</p><p>子运、木火运，风宪。</p><p>辰巳有倚托者，极品。</p><p>己巳日甲戌时，寅午戌月，金神入火乡，贵显。</p><p>亥戌年月，官居守令，极有声名。</p><p>子月、木火运，极品。</p><p>己末日甲戌时，克陷遭刑。</p><p>寅午年月，三、四品，贵。</p><p>戌月、东南运，五品。</p><p>纯辛卯年月，刑。</p><p>己酉日甲戌时，辰丑刑冲，财源益进。</p><p>酉戌相害，名利中平。</p><p>子月，己贵。</p><p>寅月，官印，行印运，贵。</p><p>纯乙酉年月，顽暴。</p><p>一云孤独离乡。</p><p>己亥日甲戌时，通土气月，要行木运；通水木月，要行身旺运，俱贵。</p><p>甲己化土气藏收，如逢匙钥福优游；假若逢财财不聚，浑如木叶值深秋。</p><p>己日时逢甲戌，妻从夫化为佳。</p><p>库财专待钥匙开，壬申丑神通泰。</p><p>父母夭孤刑克，雁行花果难谐。</p><p>若逢时运一时来，家业兴隆亨快。</p>",37),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","237卷 九·六己日甲戌时断.html.vue"]]);export{f as default};
